import { todoCount, subscribeRpt } from '@/api/indicators/dashboard';
import CountTo from 'vue-count-to';
export default {
  components: {
    CountTo: CountTo
  },
  data: function data() {
    return {
      activeName: 'second',
      count: {
        todo: '',
        newIp: 0,
        newVisits: 0,
        recentIp: 0,
        recentVisits: 0
      },
      subscribe: {
        title: '我的订阅',
        total: ''
      }
    };
  },
  mounted: function mounted() {
    var _this = this;

    todoCount().then(function (res) {
      if (res.code === '0') {
        _this.count.todo = res.data.total;
      }
    });
    subscribeRpt().then(function (res) {
      _this.subscribe.total = res.data.total;
    });
  },
  methods: {
    openTodoList: function openTodoList() {
      this.$router.push({
        path: '/indicator/waitApprove'
      });
    },
    openFavorite: function openFavorite() {
      this.$router.push({
        path: '/indicator/resultSubscribe/index'
      });
    },
    openReport: function openReport() {
      //this.$router.push({path: '../indicator/notice'})
      this.$router.push({
        path: '/indicator/noticeQuery'
      });
    },

    /*openIndex() {
        this.$router.push({path: '/indicators/query'})
    },*/
    openSubscribeList: function openSubscribeList() {
      this.$router.push({
        path: '/indicator/resultSubscribe'
      });
    }
  }
};
